import React from 'react';
import { Container, Card, CardHeader, CardBody, Heading, Stack, Input, InputGroup, InputRightElement, Button, CardFooter } from '@chakra-ui/react'
import { FormControl, FormLabel } from '@chakra-ui/react'
import { useNavigate } from 'react-router-dom';


function TextChat() {

    const [show, setShow] = React.useState(false)
    const handleClick = () => setShow(!show)
    let navigate = useNavigate();


    const submit = (e) => {
        e.preventDefault();
        fetch('/login', {
            method: 'POST',
            body: JSON.stringify({
                "email": document.getElementById("email").value,
                "Password": document.getElementById("password").value
            }),
            headers: { "Content-Type": "application/json" }
        }).then(response => {
            console.log(response)
            if (response['status'] === 200) {
                return navigate("/data-analytics")
            }
        });
    }

    return (
        <div className="App">
            <header>
                <HStack justify="center">
                    <Button onClick={redirectDataAnalytics}>Data Analytics</Button>
                    <Button onClick={redirectTextChat}>Text Chat</Button>
                </HStack>
            </header>


            <div className="outer employees">
                <Heading size="lg">Employees</Heading>
                <div className="inner employees">
                    <DataTable columns={columns} data={data} />
                </div>
            </div>
        </div>
    );
}

export default TextChat;
